import axios from "axios";

const ASSOCIATION_API_BASE_URL = "http://localhost:8080/fees";
const headers = {
    'Content-Type': 'application/json'
}

export function insertFee(fee) {
    return axios.post(ASSOCIATION_API_BASE_URL, fee, {headers})
}

export function getAllFee() {
    return axios.get(ASSOCIATION_API_BASE_URL);
}

export function updateFee(feeId, fee) {
    return axios.put(ASSOCIATION_API_BASE_URL + '/' + feeId, fee, {headers})
}
